import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Navbar from "./components/Navbar";
import Dashboard from "./pages/Dashboard";
import ValidIssues from "./pages/ValidIssues";
import InvalidIssues from "./pages/InvalidIssues";

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="/valid" element={<ValidIssues />} />
        <Route path="/invalid" element={<InvalidIssues />} />
      </Routes>
    </Router>
  );
}

export default App;
